import React, { useState } from 'react'
import Stepper from './Stepper'

function WorkingExp() {

    const [workingExpSource, setWorkingExpSource] = useState();

    return (
        <div>
            <h1>Working Experiences</h1>
            <Stepper source={workingExpSource} />

        </div>
    )
}

export default WorkingExp
